import React, {Component} from 'react';

class Form extends Component {
    constructor(props) {
        super(props)
    }
    render() {
        const {inputCity} = this.props
        return (
            <form onSubmit={inputCity}>
                <button>Get Weather</button>
            </form>
        )
    }
}

export default Form;
